/**
 * Logout Success Page
 * Displayed after successful logout
 */

import React from 'react';
import { useNavigate } from 'react-router-dom';
import { CheckCircle } from 'phosphor-react';
import '../styles/Login.css';

function LogoutSuccess() {
    const navigate = useNavigate();

    const handleLoginAgain = () => {
        navigate('/');
        window.location.reload(); // Force reload to trigger login
    };

    return (
        <div className="login-container">
            <div className="login-card">
                <div className="login-header">
                    <div className="success-icon">
                        <CheckCircle size={64} weight="fill" color="#28a745" />
                    </div>
                    <h1>Logout Berhasil</h1>
                    <p className="logout-message">Anda telah berhasil keluar dari sistem PEMDA DIY Dashboard.</p>
                </div>

                <div className="logout-info">
                    <p>Sesi Anda telah dihapus dengan aman.</p>
                    <p>Terima kasih telah menggunakan layanan kami.</p>
                </div>

                <button onClick={handleLoginAgain} className="login-button">
                    Login Kembali
                </button>

                <div className="logout-footer">
                    <p>Â© 2026 PEMDA DIY Dashboard</p>
                </div>
            </div>

            <style jsx="true">{`
        .success-icon {
          display: flex;
          justify-content: center;
          margin-bottom: 1.5rem;
          anim

ation: scaleIn 0.5s ease;
        }

        .logout-message {
          font-size: 1.1rem;
          color: #495057;
          margin-top: 1rem;
        }

        .logout-info {
          background: #f8f9fa;
          padding: 1.5rem;
          border-radius: 8px;
          margin: 1.5rem 0;
          text-align: center;
        }

        .logout-info p {
          margin: 0.5rem 0;
          color: #6c757d;
        }

        .logout-footer {
          margin-top: 2rem;
          padding-top: 1rem;
          border-top: 1px solid #dee2e6;
          text-align: center;
          color: #6c757d;
          font-size: 0.9rem;
        }

        @keyframes scaleIn {
          from {
            transform: scale(0);
          }
          to {
            transform: scale(1);
          }
        }
      `}</style>
        </div>
    );
}

export default LogoutSuccess;
